      "NODE_ENV": "development",
      "PROJECT_NAME": "dstack-js-sdk-demo"
    },
    "hook": {
      "on-activate": "  echo \"üöÄ Activating dstack JS SDK Demo environment...\"\n  \n  # Check if package.json exists and install dependencies\n  if [ -f \"$FLOX_ENV_PROJECT/package.json\" ]; then\n    echo \"üì¶ Installing npm dependencies...\"\n    npm install\n  fi\n  \n  # Check if Prisma schema exists and generate client\n  if [ -f \"$FLOX_ENV_PROJECT/prisma/schema.prisma\" ]; then\n    echo \"üóÑÔ∏è Generating Prisma client...\"\n    npx prisma generate\n  fi\n  \n  echo \"‚úÖ Environment ready! Node.js $(node --version) | npm $(npm --version)\"\n  echo \"üìù Project: $PROJECT_NAME\"\n"
    },
    "profile": {
      "common": "  # Add useful aliases for the project\n  alias dev=\"npm run dev\"\n  alias build=\"npm run build\"\n  alias test=\"npm test\"\n  alias db:migrate=\"npx prisma migrate dev\"\n  alias db:studio=\"npx prisma studio\"\n  \n  # Set command prompt to show we're in Flox environment\n  export PS1=\"[flox:the-accountant] $PS1\"\n"
    },
    "options": {
      "systems": [
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    }
